import React, {useState} from 'react'
import "../Live1/Live1.css"

export default function card(props){
  return (
    <>
    <div className='cards'>
      hello world
      <div className="itemname">{props.itemname}</div>
        <div className="price">{props.itemprice}</div>
    </div>
    </>
  );
};
